mixin ObjectTypeAbstract--YDF_DK(propertiesObject)

  -

    const {
      typeName,
      localizedDescriptiveHeading,
      propertiesSpecification
    } = propertiesObject;


  .ObjectTypeAbstract--YDF_DK&attributes(attributes)

    .ObjectTypeAbstract--YDF_DK-TypeNameHeading= typeName

    if localizedDescriptiveHeading

      .ObjectTypeAbstract--YDF_DK-LocalizedDescriptiveHeading= localizedDescriptiveHeading


    if Array.isArray(propertiesSpecification.$intersection)

      .ObjectTypeAbstract--YDF_DK-Bracket {

      each intersectionCompound, intersectionCompoundIndex in propertiesSpecification.$intersection

        if Array.isArray(intersectionCompound)

          - const internalUnion = intersectionCompound;

          div.ObjectTypeAbstract--YDF_DK-Bracket (

          .ObjectTypeAbstract--YDF_DK-Bracket.ObjectTypeAbstract--YDF_DK-Bracket__NewLineAndIncreasedIndentation {

          each internalUnionCompound, internalUnionCompoundIndex in internalUnion

            +ObjectTypeAbstract-PropertiesSpecification--YDF_DK(internalUnionCompound)

            if internalUnionCompoundIndex < internalUnion.length - 1

              .ObjectTypeAbstract--YDF_DK-Bracket.ObjectTypeAbstract--YDF_DK-Bracket__NewLineAndIncreasedIndentation } ИЛИ {

            else

              .ObjectTypeAbstract--YDF_DK-Bracket.ObjectTypeAbstract--YDF_DK-Bracket__NewLineAndIncreasedIndentation }

              if intersectionCompoundIndex < propertiesSpecification.$intersection.length - 1

                .ObjectTypeAbstract--YDF_DK-Bracket ) И

              else

                .ObjectTypeAbstract--YDF_DK-Bracket )

        else

          +ObjectTypeAbstract-PropertiesSpecification--YDF_DK(intersectionCompound)

          if intersectionCompoundIndex < propertiesSpecification.$intersection.length - 1

            .ObjectTypeAbstract--YDF_DK-Bracket } И

          else

            | }

        //-
          if index < propertiesSpecification.$intersection.length - 1
            .ObjectTypeAbstract--YDF_DK-Bracket } 又は {


    else if Array.isArray(propertiesSpecification.$union)

      div $union

    else

      .ObjectTypeAbstract--YDF_DK-Bracket {

      +ObjectTypeAbstract-PropertiesSpecification--YDF_DK(propertiesSpecification)

      .ObjectTypeAbstract--YDF_DK-Bracket }


mixin ObjectTypeAbstract-PropertiesSpecification--YDF_DK(propertiesSpecification)

  dl.ObjectTypeAbstract--YDF_DK-PropertiesList()

    each propertySpecification, propertyKey in propertiesSpecification

      dt.ObjectTypeAbstract--YDF_DK-PropertiesList-Key= propertyKey
      dd.ObjectTypeAbstract--YDF_DK-PropertiesList-Value
        +ObjectTypeAbstract-PropertySpecification--YDF_DK({
          ...propertySpecification,
          ...{ key: propertyKey }
        })


mixin ObjectTypeAbstract-PropertySpecification--YDF_DK(propertySpecification)

  dl.ObjectTypeAbstract-PropertySpecification--YDF_DK

    if propertySpecification.localizedInterpretation

      dt.ObjectTypeAbstract-PropertySpecification--YDF_DK-Key Русскоязычное наименование
      dd.ObjectTypeAbstract-PropertySpecification--YDF_DK-Value= propertySpecification.localizedInterpretation

      dt.ObjectTypeAbstract-PropertySpecification--YDF_DK-Key Тип
      dd.ObjectTypeAbstract-PropertySpecification--YDF_DK-Value(
        class="ObjectTypeAbstract-PropertySpecification--YDF_DK-Value__Accented"
      )= propertySpecification.type

      if propertySpecification.required === true

        dt.ObjectTypeAbstract-PropertySpecification--YDF_DK-Key Обязательный
        dd.ObjectTypeAbstract-PropertySpecification--YDF_DK-Value Да

      else if propertySpecification.required === false

        dt.ObjectTypeAbstract-PropertySpecification--YDF_DK-Key Обязательный
        dd.ObjectTypeAbstract-PropertySpecification--YDF_DK-Value Нет

      else if isNotUndefined(propertySpecification.defaultValue)

        dt.ObjectTypeAbstract-PropertySpecification--YDF_DK-Key Значение по умолчанию
        dd.ObjectTypeAbstract-PropertySpecification--YDF_DK-Value= propertySpecification.defaultValue
